var drawPath = function (path) {
	for (var i = 1; i < path.length; i ++){
		var s = [path[i-1][0],path[i-1][1]];
		var d = [path[i][0],path[i][1]];
		if(path[i][3] == '10m'){
			L.polyline([s,d] , {color: pColor[0]}).addTo(self.map);
		}
		else if(path[i][3] == '100m'){
			L.polyline([s,d] , {color: pColor[1]}).addTo(self.map);
		}
		else if(path[i][3] == '50mb'){
			L.polyline([s,d] , {color: pColor[2]}).addTo(self.map);
		}
		else if(path[i][3] == '100mb'){
			L.polyline([s,d] , {color: pColor[3]}).addTo(self.map);
		}
		else if(path[i][3] == '200mb'){
			L.polyline([s,d] , {color: pColor[4]}).addTo(self.map);
		}
		else if(path[i][3] == '250mb'){
			L.polyline([s,d] , {color: pColor[5]}).addTo(self.map);
		}
	}
};

var initWind = function(){
	// load data (u, v grids) from somewhere (e.g. https://github.com/danwild/wind-js-server)
	data_path = '../JSON/';
    data_date = '2019061200';
    data_type = [
        '10mab',
        '80mab',
        '100mab',
        '975mb',
        '950mb',
        '925mb',
        '900mb',
        '850mb',
        '800mb',
        '750mb',
        '700mb',
        '650mb',
        '600mb',
        '550mb',
        '500mb',
        '450mb',
        '400mb',
        '350mb',
        '300mb',
        '250mb',
    ];
    data_type.forEach(function (type){
			$.getJSON(data_path + data_date + '/' + type + '.json', function (data) {
			self.velocityLayer = L.velocityLayer({
				displayValues: true,
				displayOptions: {
					velocityType: type,
					displayPosition: 'bottomleft',
					displayEmptyString: 'No wind data'
				},
				data: data,
				maxVelocity: 10
			});
			layerControl.addOverlay(velocityLayer, type);
			if(type == '80mab'){
				velocityLayer.addTo(self.map);
			}
		});
	});
};
var switchLayer = function(point, nextLayer){
	
	nextLayer.addTo(self.map);
	nextLayer.setPath(point);
}

